import './App.css';
import {BrowserRouter as Router, Route} from "react-router-dom";
import User from "./Router/components/pages/User";

function App() {
  return (
    <Router>
      <div>
          <Route exact path="/User" component={User} />
      </div>
    </Router>

  );
}

export default App;
